INSERT INTO `document` VALUES (1, 'springboot自定义配置', 'Sean', '原创', '2018-06-23 18:03:48', 'Sean', 3, '###springboot自定义配置\n---\n\nspringboot最大的优势之一就是其默认配置，坚持约定大于配置的原则，我们不用做任何配置就可以启动一个简单的demo。 \n\n除了使用默认提供的配置属性之外，它还提供了灵活的自定义配置，下面我们一起来学习如何使用灵活使用配置文件吧！\n\n---\n\n####一、使用默认配置文件\n默认配置文件包括你写的多环境的配置文件，比如**application.properties、application-dev.properties**等，在这些配置文件中我们自定义配置属性并读取。\n>在application.properties中新加一个属性\n\n    a.a=aa\n\n>在测试类中读取到hello的值\n\n        @RunWith(SpringRunner.class)\n        @SpringBootTest\n        public class Demo01ApplicationTests {\n            \n            @Value(value = \"${a.a}\")\n            private String aa;\n            \n            @Test\n            public void test1(){\n             System.out.println(aa);\n             }\n        }\n\n可以看到成功打印 aa\n####二、自定义配置文件\n#####2.1 使用@PropertySource注解\n>在resources目录下新建 **/config/people.properties** 配置文件，内容如下\n\n    people.name=sean\n    people.age=12\n\n>新建people类来接收people.properties的属性\n\n    @Component\n    @PropertySource(\"classpath:/config/people.properties\")\n    public class People {\n\n        @Value(\"${people.name}\")\n        private String name;\n\n        @Value(\"${people.age}\")\n        private String age;\n\n        /**...省略get、set方法...**/\n    }\n\n>测试输出people\n\n    @RunWith(SpringRunner.class)\n    @SpringBootTest\n    public class Demo01ApplicationTests {\n    \n        @Autowired\n        private People people;\n    \n        @Test\n        public void test2(){\n            System.out.println(people.getName());\n            System.out.println(people.getAge());\n        }\n    }\n\n>@PropertySource注解的其它属性，我们可以进去看看这个注解的源码\n\n    @Target({ElementType.TYPE})\n    @Retention(RetentionPolicy.RUNTIME)\n    @Documented\n    @Repeatable(PropertySources.class)\n    public @interface PropertySource {\n        String name() default \"\";\n\n        String[] value();\n\n        boolean ignoreResourceNotFound() default false;\n\n        String encoding() default \"\";\n\n        Class<? extends PropertySourceFactory> factory() default PropertySourceFactory.class;\n    }\n\n其中name值是唯一的，默认值是**class path resource [config/people.properties]**。\n\nignoreResourceNotFound 是指如果文件不存在是否报错，默认false，即报错。\n\nencoding 指定字符编码。\n\n####三、使用@ConfigurationProperties 注解\n如果存在大量的配置属性时，一个个@Value太麻烦，我们可以结合@ConfigurationProperties注解来更方便的读取配置内容，请看下面的例子。\n>新建/config/user.properties配置文件，内容如下\n\n    user.age=12\n    user.address=beijing\n\n>新建User类\n\n    @Component\n    @PropertySource(value = \"classpath:/config/user.properties\")\n    @ConfigurationProperties(prefix = \"user\")\n    public class User {\n\n        private String address;\n\n        private int age;\n\n        public String getAddress() {\n            return address;\n        }\n\n        public void setAddress(String address) {\n            this.address = address;\n        }\n\n        public int getAge() {\n            return age;\n        }\n\n        public void setAge(int age) {\n            this.age = age;\n        }\n    }\n\n使用@ConfigurationProperties注解时，idea会出现警告:Spring Boot Configuration Annotation Processor not found in classpath，我们在pom文件添加下面依赖即可。\n    \n    <dependency>\n        <groupId>org.springframework.boot</groupId>\n        <artifactId>spring-boot-configuration-processor</artifactId>\n        <optional>true</optional>\n    </dependency>\n\n\n>测试 \n\n    @RunWith(SpringRunner.class)\n    @SpringBootTest\n    public class UserTest {\n\n        @Autowired\n        private User user;\n\n        @Test\n        public void test1(){\n            System.out.println(user.getAge());\n            System.out.println(user.getAddress());\n        }\n    }\n\n---\n--完--', '<article class=\"markdown-body\"><h3 id=\"springboot\">springboot自定义配置<a class=\"headerlink\" href=\"#springboot\" title=\"Permanent link\"></a></h3>\n<hr />\n<p>springboot最大的优势之一就是其默认配置，坚持约定大于配置的原则，我们不用做任何配置就可以启动一个简单的demo。 </p>\n<p>除了使用默认提供的配置属性之外，它还提供了灵活的自定义配置，下面我们一起来学习如何使用灵活使用配置文件吧！</p>\n<hr />\n<h4 id=\"_1\">一、使用默认配置文件<a class=\"headerlink\" href=\"#_1\" title=\"Permanent link\"></a></h4>\n<p>默认配置文件包括你写的多环境的配置文件，比如<strong>application.properties、application-dev.properties</strong>等，在这些配置文件中我们自定义配置属性并读取。</p>\n<blockquote>\n<p>在application.properties中新加一个属性</p>\n</blockquote>\n<div class=\"codehilite\"><pre>a.a=aa\n</pre></div>\n\n\n<blockquote>\n<p>在测试类中读取到hello的值</p>\n</blockquote>\n<div class=\"codehilite\"><pre>    @RunWith(SpringRunner.class)\n    @SpringBootTest\n    public class Demo01ApplicationTests {\n\n        @Value(value = &quot;${a.a}&quot;)\n        private String aa;\n\n        @Test\n        public void test1(){\n         System.out.println(aa);\n         }\n    }\n</pre></div>\n\n\n<p>可以看到成功打印 aa</p>\n<h4 id=\"_2\">二、自定义配置文件<a class=\"headerlink\" href=\"#_2\" title=\"Permanent link\"></a></h4>\n<h5 id=\"21-propertysource\">2.1 使用@PropertySource注解<a class=\"headerlink\" href=\"#21-propertysource\" title=\"Permanent link\"></a></h5>\n<blockquote>\n<p>在resources目录下新建 <strong>/config/people.properties</strong> 配置文件，内容如下</p>\n</blockquote>\n<div class=\"codehilite\"><pre>people.name=sean\npeople.age=12\n</pre></div>\n\n\n<blockquote>\n<p>新建people类来接收people.properties的属性</p>\n</blockquote>\n<div class=\"codehilite\"><pre>@Component\n@PropertySource(&quot;classpath:/config/people.properties&quot;)\npublic class People {\n\n    @Value(&quot;${people.name}&quot;)\n    private String name;\n\n    @Value(&quot;${people.age}&quot;)\n    private String age;\n\n    /**...省略get、set方法...**/\n}\n</pre></div>\n\n\n<blockquote>\n<p>测试输出people</p>\n</blockquote>\n<div class=\"codehilite\"><pre>@RunWith(SpringRunner.class)\n@SpringBootTest\npublic class Demo01ApplicationTests {\n\n    @Autowired\n    private People people;\n\n    @Test\n    public void test2(){\n        System.out.println(people.getName());\n        System.out.println(people.getAge());\n    }\n}\n</pre></div>\n\n\n<blockquote>\n<p>@PropertySource注解的其它属性，我们可以进去看看这个注解的源码</p>\n</blockquote>\n<div class=\"codehilite\"><pre>@Target({ElementType.TYPE})\n@Retention(RetentionPolicy.RUNTIME)\n@Documented\n@Repeatable(PropertySources.class)\npublic @interface PropertySource {\n    String name() default &quot;&quot;;\n\n    String[] value();\n\n    boolean ignoreResourceNotFound() default false;\n\n    String encoding() default &quot;&quot;;\n\n    Class&lt;? extends PropertySourceFactory&gt; factory() default PropertySourceFactory.class;\n}\n</pre></div>\n\n\n<p>其中name值是唯一的，默认值是<strong>class path resource [config/people.properties]</strong>。</p>\n<p>ignoreResourceNotFound 是指如果文件不存在是否报错，默认false，即报错。</p>\n<p>encoding 指定字符编码。</p>\n<h4 id=\"configurationproperties\">三、使用<a class=\"magiclink magiclink-github magiclink-mention\" href=\"https://github.com/ConfigurationProperties\" title=\"GitHub User: ConfigurationProperties\">@ConfigurationProperties</a> 注解<a class=\"headerlink\" href=\"#configurationproperties\" title=\"Permanent link\"></a></h4>\n<p>如果存在大量的配置属性时，一个个@Value太麻烦，我们可以结合@ConfigurationProperties注解来更方便的读取配置内容，请看下面的例子。</p>\n<blockquote>\n<p>新建/config/user.properties配置文件，内容如下</p>\n</blockquote>\n<div class=\"codehilite\"><pre>user.age=12\nuser.address=beijing\n</pre></div>\n\n\n<blockquote>\n<p>新建User类</p>\n</blockquote>\n<div class=\"codehilite\"><pre>@Component\n@PropertySource(value = &quot;classpath:/config/user.properties&quot;)\n@ConfigurationProperties(prefix = &quot;user&quot;)\npublic class User {\n\n    private String address;\n\n    private int age;\n\n    public String getAddress() {\n        return address;\n    }\n\n    public void setAddress(String address) {\n        this.address = address;\n    }\n\n    public int getAge() {\n        return age;\n    }\n\n    public void setAge(int age) {\n        this.age = age;\n    }\n}\n</pre></div>\n\n\n<p>使用@ConfigurationProperties注解时，idea会出现警告:Spring Boot Configuration Annotation Processor not found in classpath，我们在pom文件添加下面依赖即可。</p>\n<div class=\"codehilite\"><pre>&lt;dependency&gt;\n    &lt;groupId&gt;org.springframework.boot&lt;/groupId&gt;\n    &lt;artifactId&gt;spring-boot-configuration-processor&lt;/artifactId&gt;\n    &lt;optional&gt;true&lt;/optional&gt;\n&lt;/dependency&gt;\n</pre></div>\n\n\n<blockquote>\n<p>测试 </p>\n</blockquote>\n<div class=\"codehilite\"><pre>@RunWith(SpringRunner.class)\n@SpringBootTest\npublic class UserTest {\n\n    @Autowired\n    private User user;\n\n    @Test\n    public void test1(){\n        System.out.println(user.getAge());\n        System.out.println(user.getAddress());\n    }\n}\n</pre></div>\n\n\n<hr />\n<p>&ndash;完&ndash;</p></article>', 'springboot自定义配置\nspringboot最大的优势之一就是其默认配置，坚持约定大于配置的原则，我们不用做任何配置就可以启动一个简单的demo。\n\n除了使用默认提供的配置属性之外，它还提供了灵活的自定义配置，下面我们一起来学习如何使用灵活使用配置文件吧！\n\n一、使用默认配置文件\n默认配置文件包括你写的多环境的配置文件，比如application.properties、application-dev.properties等，在这些配置文件中我们自定义配置属性并读取。\n\n在application.properties中新加一个属性\n\na.a=aa\n在测试类中读取到hello的值\n\n    @RunWith(SpringRunner.class)\n    @SpringBootTest\n    public class Demo01ApplicationTests {\n\n        @Value(value = \"${a.a}\")\n        private String aa;\n\n        @Test\n        public void test1(){\n         System.out.println(aa);\n         }\n    }\n可以看到成功打印 aa\n\n二、自定义配置文件\n2.1 使用@PropertySource注解\n在resources目录下新建 /config/people.properties 配置文件，内容如下\n\npeople.name=sean\npeople.age=12\n新建people类来接收people.properties的属性\n\n@Component\n@PropertySource(\"classpath:/config/people.properties\")\npublic class People {\n\n    @Value(\"${people.name}\")\n    private String name;\n\n    @Value(\"${people.age}\")\n    private String age;\n\n    /**...省略get、set方法...**/\n}\n测试输出people\n\n@RunWith(SpringRunner.class)\n@SpringBootTest\npublic class Demo01ApplicationTests {\n\n    @Autowired\n    private People people;\n\n    @Test\n    public void test2(){\n        System.out.println(people.getName());\n        System.out.println(people.getAge());\n    }\n}\n@PropertySource注解的其它属性，我们可以进去看看这个注解的源码\n\n@Target({ElementType.TYPE})\n@Retention(RetentionPolicy.RUNTIME)\n@Documented\n@Repeatable(PropertySources.class)\npublic @interface PropertySource {\n    String name() default \"\";\n\n    String[] value();\n\n    boolean ignoreResourceNotFound() default false;\n\n    String encoding() default \"\";\n\n    Class<? extends PropertySourceFactory> factory() default PropertySourceFactory.class;\n}\n其中name值是唯一的，默认值是class path resource [config/people.properties]。\n\nignoreResourceNotFound 是指如果文件不存在是否报错，默认false，即报错。\n\nencoding 指定字符编码。\n\n三、使用@ConfigurationProperties 注解\n如果存在大量的配置属性时，一个个@Value太麻烦，我们可以结合@ConfigurationProperties注解来更方便的读取配置内容，请看下面的例子。\n\n新建/config/user.properties配置文件，内容如下\n\nuser.age=12\nuser.address=beijing\n新建User类\n\n@Component\n@PropertySource(value = \"classpath:/config/user.properties\")\n@ConfigurationProperties(prefix = \"user\")\npublic class User {\n\n    private String address;\n\n    private int age;\n\n    public String getAddress() {\n        return address;\n    }\n\n    public void setAddress(String address) {\n        this.address = address;\n    }\n\n    public int getAge() {\n        return age;\n    }\n\n    public void setAge(int age) {\n        this.age = age;\n    }\n}\n使用@ConfigurationProperties注解时，idea会出现警告:Spring Boot Configuration Annotation Processor not found in classpath，我们在pom文件添加下面依赖即可。\n\n<dependency>\n    <groupId>org.springframework.boot</groupId>\n    <artifactId>spring-boot-configuration-processor</artifactId>\n    <optional>true</optional>\n</dependency>\n测试\n\n@RunWith(SpringRunner.class)\n@SpringBootTest\npublic class UserTest {\n\n    @Autowired\n    private User user;\n\n    @Test\n    public void test1(){\n        System.out.println(user.getAge());\n        System.out.println(user.getAddress());\n    }\n}\n–完–', 34);
INSERT INTO `document` VALUES (2, 'Linux下安装jdk', 'Sean', '原创', '2018-08-30 11:03:32', 'Sean', 12, '## Linux下安装jdk\r\n\r\n\r\n### 一、查看操作系统信息\r\n\r\n我们在Centos7下进行操作。运行命令查看操作系统版本和cpu信息。\r\n\r\n#### 1.1 查看Linux版本信息\r\n\r\n```\r\nlsg_release -a\r\n```\r\n\r\n>\r\nLSB Version:    :core-4.1-amd64:core-4.1-noarch <br/>\r\nDistributor ID: CentOS </br>\r\nDescription:    CentOS Linux release 7.4.1708 (Core) </br>\r\nRelease:    7.4.1708 <br/>\r\nCodename:   Core <br/>\r\n\r\n\r\n#### 1.2 查看cpu信息\r\n\r\n```\r\nuname -a\r\n```\r\n\r\n>\r\nLinux iZj6cf6x67njae75u07qsdZ 3.10.0-693.2.2.el7.x86_64 #1 SMP Tue Sep 12 22:26:13 UTC 2017 x86_64 x86_64 x86_64 GNU/Linux\r\n\r\n如果出现 **x86_64** 说明是64位，如果出现 **i686** 说明是32位的.\r\n\r\n### 二、下载jdk并配置环境变量\r\n\r\n\r\n#### 2.1 下载jdk\r\n我们去[官网](http://www.oracle.com/technetwork/java/javase/downloads/jdk8-downloads-2133151.html)找到1.8版本，接受Licence并找到Linux64版本.\r\n\r\n![官网jdk版本信息](https://raw.githubusercontent.com/SilencedH/other/master/linux/Linux安装环境/imgs/官网jdk版本信息.png)\r\n\r\n进入要安装jdk文件的目录，运行下面下载命令。\r\n\r\n```\r\nwget --no-check-certificate --no-cookies --header \"Cookie: oraclelicense=accept-securebackup-cookie\" http://download.oracle.com/otn-pub/java/jdk/8u181-b13/96a7b8442fe848ef90c96a2fad6ed6d1/jdk-8u181-linux-x64.tar.gz\r\n```\r\n\r\n**说明 **\r\n\r\n* 由于下载jdk需要同意License,所以在Linux下载时不能直接 **wget 地址** ,需要加上一些参数。\r\n* 如果想要下载其他版本，直接修改http之后的地址即可。\r\n* 也可以在windows下载后上传到Linux。\r\n\r\n#### 2.2 解压\r\n\r\n```\r\ntar -zxvf jdk-8u181-linux-x64.tar.gz \r\n```\r\n\r\n#### 2.3 配置环境变量\r\n\r\n```\r\nvim /etc/profile\r\n```\r\n\r\n增加以下配置内容\r\n\r\n```\r\n#set java environment\r\nJAVA_HOME=/usr/src/java/jdk1.8.0_181\r\nCLASSPATH=$JAVA_HOME/lib\r\nPATH=$PATH:$JAVA_HOME/bin\r\nexport PATH JAVA_HOME CLASSPATH\r\n```\r\n\r\n使配置文件生效\r\n\r\n```\r\nsource /etc/profile\r\n```\r\n\r\n### 三、安装成功\r\n\r\n运行 **java** 和 **javac**，如果出现Java命令信息表示成功。\r\n\r\n```\r\njava\r\n\r\njavac\r\n```\r\n\r\n---\r\n\r\n--完--', '<article class=\"markdown-body\">\r\n        <h2 id=\"linuxjdk\">Linux下安装jdk<a class=\"headerlink\" href=\"#linuxjdk\" title=\"Permanent link\"></a></h2>\r\n        <h3 id=\"_1\">一、查看操作系统信息<a class=\"headerlink\" href=\"#_1\" title=\"Permanent link\"></a></h3>\r\n        <p>我们在Centos7下进行操作。运行命令查看操作系统版本和cpu信息。</p>\r\n        <h4 id=\"11-linux\">1.1 查看Linux版本信息<a class=\"headerlink\" href=\"#11-linux\" title=\"Permanent link\"></a></h4>\r\n        <div class=\"codehilite\"><pre>lsg_release -a\r\n</pre></div>\r\n        <blockquote>\r\n            <p>LSB Version: :core-4.1-amd64:core-4.1-noarch\r\n                <br/> Distributor ID: CentOS </br>\r\n                Description: CentOS Linux release 7.4.1708 (Core) </br>\r\n                Release: 7.4.1708\r\n                <br/> Codename: Core\r\n                <br/>\r\n            </p>\r\n        </blockquote>\r\n        <h4 id=\"12-cpu\">1.2 查看cpu信息<a class=\"headerlink\" href=\"#12-cpu\" title=\"Permanent link\"></a></h4>\r\n        <div class=\"codehilite\"><pre>uname -a\r\n</pre></div>\r\n        <blockquote>\r\n            <p>Linux iZj6cf6x67njae75u07qsdZ 3.10.0-693.2.2.el7.x86_64 #1 SMP Tue Sep 12 22:26:13 UTC 2017 x86_64 x86_64 x86_64 GNU/Linux</p>\r\n        </blockquote>\r\n        <p>如果出现 <strong>x86_64</strong> 说明是64位，如果出现 <strong>i686</strong> 说明是32位的.</p>\r\n        <h3 id=\"jdk\">二、下载jdk并配置环境变量<a class=\"headerlink\" href=\"#jdk\" title=\"Permanent link\"></a></h3>\r\n        <h4 id=\"21-jdk\">2.1 下载jdk<a class=\"headerlink\" href=\"#21-jdk\" title=\"Permanent link\"></a></h4>\r\n        <p>我们去<a href=\"http://www.oracle.com/technetwork/java/javase/downloads/jdk8-downloads-2133151.html\">官网</a>找到1.8版本，接受Licence并找到Linux64版本.</p>\r\n        <p><img alt=\"官网jdk版本信息\" src=\"https://raw.githubusercontent.com/SilencedH/other/master/linux/Linux安装环境/imgs/官网jdk版本信息.png\" /></p>\r\n        <p>进入要安装jdk文件的目录，运行下面下载命令。</p>\r\n        <div class=\"codehilite\"><pre>wget --no-check-certificate --no-cookies --header &quot;Cookie: oraclelicense=accept-securebackup-cookie&quot; http://download.oracle.com/otn-pub/java/jdk/8u181-b13/96a7b8442fe848ef90c96a2fad6ed6d1/jdk-8u181-linux-x64.tar.gz\r\n</pre></div>\r\n        <p><strong>说明 </strong></p>\r\n        <ul>\r\n            <li>由于下载jdk需要同意License,所以在Linux下载时不能直接 <strong>wget 地址</strong> ,需要加上一些参数。</li>\r\n            <li>如果想要下载其他版本，直接修改http之后的地址即可。</li>\r\n            <li>也可以在windows下载后上传到Linux。</li>\r\n        </ul>\r\n        <h4 id=\"22\">2.2 解压<a class=\"headerlink\" href=\"#22\" title=\"Permanent link\"></a></h4>\r\n        <div class=\"codehilite\"><pre>tar -zxvf jdk-8u181-linux-x64.tar.gz \r\n</pre></div>\r\n        <h4 id=\"23\">2.3 配置环境变量<a class=\"headerlink\" href=\"#23\" title=\"Permanent link\"></a></h4>\r\n        <div class=\"codehilite\"><pre>vim /etc/profile\r\n</pre></div>\r\n        <p>增加以下配置内容</p>\r\n        <div class=\"codehilite\"><pre>#set java environment\r\nJAVA_HOME=/usr/src/java/jdk1.8.0_181\r\nCLASSPATH=$JAVA_HOME/lib\r\nPATH=$PATH:$JAVA_HOME/bin\r\nexport PATH JAVA_HOME CLASSPATH\r\n</pre></div>\r\n        <p>使配置文件生效</p>\r\n        <div class=\"codehilite\"><pre>source /etc/profile\r\n</pre></div>\r\n        <h3 id=\"_2\">三、安装成功<a class=\"headerlink\" href=\"#_2\" title=\"Permanent link\"></a></h3>\r\n        <p>运行 <strong>java</strong> 和 <strong>javac</strong>，如果出现Java命令信息表示成功。</p>\r\n        <div class=\"codehilite\"><pre>java\r\n\r\njavac\r\n</pre></div>\r\n        <hr />\r\n        <p>&ndash;完&ndash;</p>\r\n    </article>', 'Linux下安装jdk\r\n一、查看操作系统信息\r\n我们在Centos7下进行操作。运行命令查看操作系统版本和cpu信息。\r\n\r\n1.1 查看Linux版本信息\r\nlsg_release -a\r\nLSB Version: :core-4.1-amd64:core-4.1-noarch \r\nDistributor ID: CentOS \r\nDescription: CentOS Linux release 7.4.1708 (Core) \r\nRelease: 7.4.1708 \r\nCodename: Core \r\n\r\n1.2 查看cpu信息\r\nuname -a\r\nLinux iZj6cf6x67njae75u07qsdZ 3.10.0-693.2.2.el7.x86_64 #1 SMP Tue Sep 12 22:26:13 UTC 2017 x86_64 x86_64 x86_64 GNU/Linux\r\n\r\n如果出现 x86_64 说明是64位，如果出现 i686 说明是32位的.\r\n\r\n二、下载jdk并配置环境变量\r\n2.1 下载jdk\r\n我们去官网找到1.8版本，接受Licence并找到Linux64版本.\r\n\r\n官网jdk版本信息\r\n\r\n进入要安装jdk文件的目录，运行下面下载命令。\r\n\r\nwget --no-check-certificate --no-cookies --header \"Cookie: oraclelicense=accept-securebackup-cookie\" http://download.oracle.com/otn-pub/java/jdk/8u181-b13/96a7b8442fe848ef90c96a2fad6ed6d1/jdk-8u181-linux-x64.tar.gz\r\n说明\r\n\r\n由于下载jdk需要同意License,所以在Linux下载时不能直接 wget 地址 ,需要加上一些参数。\r\n如果想要下载其他版本，直接修改http之后的地址即可。\r\n也可以在windows下载后上传到Linux。\r\n2.2 解压\r\ntar -zxvf jdk-8u181-linux-x64.tar.gz \r\n2.3 配置环境变量\r\nvim /etc/profile\r\n增加以下配置内容\r\n\r\n#set java environment\r\nJAVA_HOME=/usr/src/java/jdk1.8.0_181\r\nCLASSPATH=$JAVA_HOME/lib\r\nPATH=$PATH:$JAVA_HOME/bin\r\nexport PATH JAVA_HOME CLASSPATH\r\n使配置文件生效\r\n\r\nsource /etc/profile\r\n三、安装成功\r\n运行 java 和 javac，如果出现Java命令信息表示成功。\r\n\r\njava\r\n\r\njavac\r\n–完–', 25);
INSERT INTO `document` VALUES (3, 'Linux安装tomcat', 'Sean', '原创', '2018-09-26 15:30:57', 'Sean', 12, '## Linux安装tomcat\r\n\r\n### 一、下载\r\n我们到[官网](https://tomcat.apache.org/download-80.cgi)找到8.5的版本，运行下面命令下载。\r\n\r\n```\r\nwget http://mirrors.hust.edu.cn/apache/tomcat/tomcat-8/v8.5.34/bin/apache-tomcat-8.5.34.tar.gz\r\n```\r\n\r\n解压\r\n\r\n```\r\ntar -zxvf apache-tomcat-8.5.34-src.tar.gz \r\n```\r\n\r\n启动\r\n\r\n```\r\ncd apache-tomcat-8.5.33/bin\r\n\r\n./startup.sh\r\n```\r\n\r\n访问8080端口号即可。', '<article class=\"markdown-body\"><h2 id=\"linuxtomcat\">Linux安装tomcat<a class=\"headerlink\" href=\"#linuxtomcat\" title=\"Permanent link\"></a></h2>\r\n<h3 id=\"_1\">一、下载<a class=\"headerlink\" href=\"#_1\" title=\"Permanent link\"></a></h3>\r\n<p>我们到<a href=\"https://tomcat.apache.org/download-80.cgi\">官网</a>找到8.5的版本，运行下面命令下载。</p>\r\n<div class=\"codehilite\"><pre>wget http://mirrors.hust.edu.cn/apache/tomcat/tomcat-8/v8.5.34/bin/apache-tomcat-8.5.34.tar.gz\r\n</pre></div>\r\n\r\n<p>解压</p>\r\n<div class=\"codehilite\"><pre>tar -zxvf apache-tomcat-8.5.34-src.tar.gz \r\n</pre></div>\r\n\r\n<p>启动</p>\r\n<div class=\"codehilite\"><pre>cd apache-tomcat-8.5.33/bin\r\n\r\n./startup.sh\r\n</pre></div>\r\n\r\n<p>访问8080端口号即可。</p></article>', 'Linux安装tomcat\r\n一、下载\r\n我们到官网找到8.5的版本，运行下面命令下载。\r\n\r\nwget http://mirrors.hust.edu.cn/apache/tomcat/tomcat-8/v8.5.34/bin/apache-tomcat-8.5.34.tar.gz\r\n解压\r\n\r\ntar -zxvf apache-tomcat-8.5.34-src.tar.gz \r\n启动\r\n\r\ncd apache-tomcat-8.5.33/bin\r\n\r\n./startup.sh\r\n访问8080端口号即可。', 2);
INSERT INTO `document` VALUES (4, 'Linux下安装nginx', 'Sean', '原创', '2018-09-26 15:33:18', 'Sean', 12, '## Linux下安装nginx\r\n\r\n### 一、下载nginx\r\n\r\n我们到[官网](https://nginx.org/download/)找到需要的版本，使用下面命令下载。\r\n\r\n```\r\nwget https://nginx.org/download/nginx-1.9.9.tar.gz\r\n```\r\n\r\n解压\r\n\r\n```\r\ntar -zxvf nginx-1.9.9.tar.gz \r\n```\r\n\r\n\r\n### 二、 编译安装\r\n\r\n#### 2.1 编译前工作\r\n\r\n检查是否安装gcc\r\n\r\n```\r\ngcc -v\r\n```\r\n\r\n如果没有，安装\r\n\r\n```\r\nyum install gcc-c++\r\n```\r\n\r\n安装pcre库\r\n```\r\nyum install pcre pcre-devel\r\n```\r\n\r\n安装zlib库\r\n```\r\nyum install zlib zlib-devel\r\n```\r\n安装openssl\r\n```\r\nyum install openssl openssl-devel\r\n```\r\n\r\n#### 2.2 编译安装\r\n\r\n```\r\ncd nginx-1.9.9\r\n\r\n./configure\r\n\r\nmake && make install\r\n```\r\n\r\n### 三、启动服务\r\n\r\n```\r\ncd /usr/local/nginx/sbin/\r\n\r\n./nginx 启动\r\n\r\n./nginx -s stop 停止\r\n\r\n./nginx -s quit 退出\r\n\r\n./nginx -s reload 重新加载\r\n\r\n./nginx -s quit:此方式停止步骤是待nginx进程处理任务完毕进行停止。\r\n\r\n./nginx -s stop:此方式相当于先查出nginx进程id再使用kill命令强制杀掉进程。\r\n```\r\n\r\n直接访问服务ip就可以了。\r\n\r\n**说明**\r\n\r\n* nginx配置、项目文件都在 **/usr/local/nginx** 目录下面\r\n* 阿里云访问时需要配置安全组开放80端口\r\n\r\n---\r\n\r\n--完--\r\n', '<article class=\"markdown-body\"><h2 id=\"linuxnginx\">Linux下安装nginx<a class=\"headerlink\" href=\"#linuxnginx\" title=\"Permanent link\"></a></h2>\r\n<h3 id=\"nginx\">一、下载nginx<a class=\"headerlink\" href=\"#nginx\" title=\"Permanent link\"></a></h3>\r\n<p>我们到<a href=\"https://nginx.org/download/\">官网</a>找到需要的版本，使用下面命令下载。</p>\r\n<div class=\"codehilite\"><pre>wget https://nginx.org/download/nginx-1.9.9.tar.gz\r\n</pre></div>\r\n\r\n<p>解压</p>\r\n<div class=\"codehilite\"><pre>tar -zxvf nginx-1.9.9.tar.gz \r\n</pre></div>\r\n\r\n<h3 id=\"_1\">二、 编译安装<a class=\"headerlink\" href=\"#_1\" title=\"Permanent link\"></a></h3>\r\n<h4 id=\"21\">2.1 编译前工作<a class=\"headerlink\" href=\"#21\" title=\"Permanent link\"></a></h4>\r\n<p>检查是否安装gcc</p>\r\n<div class=\"codehilite\"><pre>gcc -v\r\n</pre></div>\r\n\r\n<p>如果没有，安装</p>\r\n<div class=\"codehilite\"><pre>yum install gcc-c++\r\n</pre></div>\r\n\r\n<p>安装pcre库\r\n<div class=\"codehilite\"><pre>yum install pcre pcre-devel\r\n</pre></div></p>\r\n<p>安装zlib库\r\n<div class=\"codehilite\"><pre>yum install zlib zlib-devel\r\n</pre></div>\r\n安装openssl\r\n<div class=\"codehilite\"><pre>yum install openssl openssl-devel\r\n</pre></div></p>\r\n<h4 id=\"22\">2.2 编译安装<a class=\"headerlink\" href=\"#22\" title=\"Permanent link\"></a></h4>\r\n<div class=\"codehilite\"><pre>cd nginx-1.9.9\r\n\r\n./configure\r\n\r\nmake &amp;&amp; make install\r\n</pre></div>\r\n\r\n<h3 id=\"_2\">三、启动服务<a class=\"headerlink\" href=\"#_2\" title=\"Permanent link\"></a></h3>\r\n<div class=\"codehilite\"><pre>cd /usr/local/nginx/sbin/\r\n\r\n./nginx 启动\r\n\r\n./nginx -s stop 停止\r\n\r\n./nginx -s quit 退出\r\n\r\n./nginx -s reload 重新加载\r\n\r\n./nginx -s quit:此方式停止步骤是待nginx进程处理任务完毕进行停止。\r\n\r\n./nginx -s stop:此方式相当于先查出nginx进程id再使用kill命令强制杀掉进程。\r\n</pre></div>\r\n\r\n<p>直接访问服务ip就可以了。</p>\r\n<p><strong>说明</strong></p>\r\n<ul>\r\n<li>nginx配置、项目文件都在 <strong>/usr/local/nginx</strong> 目录下面</li>\r\n<li>阿里云访问时需要配置安全组开放80端口</li>\r\n</ul>\r\n<hr />\r\n<p>&ndash;完&ndash;</p></article>', 'Linux下安装nginx\r\n一、下载nginx\r\n我们到官网找到需要的版本，使用下面命令下载。\r\n\r\nwget https://nginx.org/download/nginx-1.9.9.tar.gz\r\n解压\r\n\r\ntar -zxvf nginx-1.9.9.tar.gz \r\n二、 编译安装\r\n2.1 编译前工作\r\n检查是否安装gcc\r\n\r\ngcc -v\r\n如果没有，安装\r\n\r\nyum install gcc-c++\r\n安装pcre库\r\n\r\nyum install pcre pcre-devel\r\n安装zlib库\r\n\r\nyum install zlib zlib-devel\r\n安装openssl\r\nyum install openssl openssl-devel\r\n2.2 编译安装\r\ncd nginx-1.9.9\r\n\r\n./configure\r\n\r\nmake && make install\r\n三、启动服务\r\ncd /usr/local/nginx/sbin/\r\n\r\n./nginx 启动\r\n\r\n./nginx -s stop 停止\r\n\r\n./nginx -s quit 退出\r\n\r\n./nginx -s reload 重新加载\r\n\r\n./nginx -s quit:此方式停止步骤是待nginx进程处理任务完毕进行停止。\r\n\r\n./nginx -s stop:此方式相当于先查出nginx进程id再使用kill命令强制杀掉进程。\r\n直接访问服务ip就可以了。\r\n\r\n说明\r\n\r\nnginx配置、项目文件都在 /usr/local/nginx 目录下面\r\n阿里云访问时需要配置安全组开放80端口\r\n–完–', 3);
INSERT INTO `document` VALUES (5, 'Linux安装MySQL5.7', 'Sean', '原创', '2018-09-26 15:36:57', 'Sean', 12, '## Linux安装MySQL5.7 \r\n\r\n### 一、安装\r\n\r\n#### 1.1 下载安装\r\n\r\n进入要安装的目录\r\n\r\n```\r\nwget http://repo.mysql.com/mysql57-community-release-el7-10.noarch.rpm\r\n```\r\n\r\n```\r\nrpm -Uvh mysql57-community-release-el7-10.noarch.rpm\r\n```\r\n\r\n安装服务端\r\n\r\n```\r\nyum install -y mysql-community-server\r\n```\r\n\r\n### 二、启动服务\r\n\r\n**启动**\r\n```\r\nservice mysqld start\r\n```\r\n\r\n**查看服务状态**\r\n\r\n```\r\nservice mysqld status\r\n```\r\n\r\n**设置开机启动**\r\n\r\n```\r\nsystemctl enable mysqld\r\n```\r\n\r\n**取消开机启动**\r\n\r\n```\r\nsystemctl disable mysqld\r\n```\r\n\r\n### 三、配置\r\n\r\n#### 3.1 设置密码\r\n\r\n安装好后，首次启动服务时MySQL会自动给我们生成一个密码，我们找到后登录，并修改。\r\n\r\n**查看生成密码**\r\n\r\n```\r\ngrep \'temporary password\' /var/log/mysqld.log\r\n```\r\n\r\n**登录MySQL**\r\n\r\n```\r\nmysql -u root -p \r\n```\r\n\r\n**修改密码规则**\r\n\r\n由于默认密码规则要求我们不能设置太简单的密码，所以我们修改一下规则。\r\n```\r\nset global validate_password_policy=0;\r\nset global validate_password_length=6;\r\n```\r\n\r\n**修改密码**\r\n\r\n```\r\nALTER USER \'root\'@\'localhost\' IDENTIFIED BY \'123456\';\r\n```\r\n\r\n#### 3.2 授权远程连接\r\n\r\n```\r\nGRANT ALL PRIVILEGES ON *.* TO \'root\'@\'%\' IDENTIFIED BY \'123456\' WITH GRANT OPTION;\r\n\r\nFLUSH PRIVILEGES;\r\n```\r\n\r\nok了。\r\n\r\n---\r\n\r\n--完--', '<article class=\"markdown-body\"><h2 id=\"linuxmysql57\">Linux安装MySQL5.7<a class=\"headerlink\" href=\"#linuxmysql57\" title=\"Permanent link\"></a></h2>\r\n<h3 id=\"_1\">一、安装<a class=\"headerlink\" href=\"#_1\" title=\"Permanent link\"></a></h3>\r\n<h4 id=\"11\">1.1 下载安装<a class=\"headerlink\" href=\"#11\" title=\"Permanent link\"></a></h4>\r\n<p>进入要安装的目录</p>\r\n<div class=\"codehilite\"><pre>wget http://repo.mysql.com/mysql57-community-release-el7-10.noarch.rpm\r\n</pre></div>\r\n\r\n<div class=\"codehilite\"><pre>rpm -Uvh mysql57-community-release-el7-10.noarch.rpm\r\n</pre></div>\r\n\r\n<p>安装服务端</p>\r\n<div class=\"codehilite\"><pre>yum install -y mysql-community-server\r\n</pre></div>\r\n\r\n<h3 id=\"_2\">二、启动服务<a class=\"headerlink\" href=\"#_2\" title=\"Permanent link\"></a></h3>\r\n<p><strong>启动</strong>\r\n<div class=\"codehilite\"><pre>service mysqld start\r\n</pre></div></p>\r\n<p><strong>查看服务状态</strong></p>\r\n<div class=\"codehilite\"><pre>service mysqld status\r\n</pre></div>\r\n\r\n<p><strong>设置开机启动</strong></p>\r\n<div class=\"codehilite\"><pre>systemctl enable mysqld\r\n</pre></div>\r\n\r\n<p><strong>取消开机启动</strong></p>\r\n<div class=\"codehilite\"><pre>systemctl disable mysqld\r\n</pre></div>\r\n\r\n<h3 id=\"_3\">三、配置<a class=\"headerlink\" href=\"#_3\" title=\"Permanent link\"></a></h3>\r\n<h4 id=\"31\">3.1 设置密码<a class=\"headerlink\" href=\"#31\" title=\"Permanent link\"></a></h4>\r\n<p>安装好后，首次启动服务时MySQL会自动给我们生成一个密码，我们找到后登录，并修改。</p>\r\n<p><strong>查看生成密码</strong></p>\r\n<div class=\"codehilite\"><pre>grep &#39;temporary password&#39; /var/log/mysqld.log\r\n</pre></div>\r\n\r\n<p><strong>登录MySQL</strong></p>\r\n<div class=\"codehilite\"><pre>mysql -u root -p \r\n</pre></div>\r\n\r\n<p><strong>修改密码规则</strong></p>\r\n<p>由于默认密码规则要求我们不能设置太简单的密码，所以我们修改一下规则。\r\n<div class=\"codehilite\"><pre>set global validate_password_policy=0;\r\nset global validate_password_length=6;\r\n</pre></div></p>\r\n<p><strong>修改密码</strong></p>\r\n<div class=\"codehilite\"><pre>ALTER USER &#39;root&#39;@&#39;localhost&#39; IDENTIFIED BY &#39;123456&#39;;\r\n</pre></div>\r\n\r\n<h4 id=\"32\">3.2 授权远程连接<a class=\"headerlink\" href=\"#32\" title=\"Permanent link\"></a></h4>\r\n<div class=\"codehilite\"><pre>GRANT ALL PRIVILEGES ON *.* TO &#39;root&#39;@&#39;%&#39; IDENTIFIED BY &#39;123456&#39; WITH GRANT OPTION;\r\n\r\nFLUSH PRIVILEGES;\r\n</pre></div>\r\n\r\n<p>ok了。</p>\r\n<hr />\r\n<p>&ndash;完&ndash;</p></article>', 'Linux安装MySQL5.7\r\n一、安装\r\n1.1 下载安装\r\n进入要安装的目录\r\n\r\nwget http://repo.mysql.com/mysql57-community-release-el7-10.noarch.rpm\r\nrpm -Uvh mysql57-community-release-el7-10.noarch.rpm\r\n安装服务端\r\n\r\nyum install -y mysql-community-server\r\n二、启动服务\r\n启动\r\n\r\nservice mysqld start\r\n查看服务状态\r\n\r\nservice mysqld status\r\n设置开机启动\r\n\r\nsystemctl enable mysqld\r\n取消开机启动\r\n\r\nsystemctl disable mysqld\r\n三、配置\r\n3.1 设置密码\r\n安装好后，首次启动服务时MySQL会自动给我们生成一个密码，我们找到后登录，并修改。\r\n\r\n查看生成密码\r\n\r\ngrep \'temporary password\' /var/log/mysqld.log\r\n登录MySQL\r\n\r\nmysql -u root -p \r\n修改密码规则\r\n\r\n由于默认密码规则要求我们不能设置太简单的密码，所以我们修改一下规则。\r\n\r\nset global validate_password_policy=0;\r\nset global validate_password_length=6;\r\n修改密码\r\n\r\nALTER USER \'root\'@\'localhost\' IDENTIFIED BY \'123456\';\r\n3.2 授权远程连接\r\nGRANT ALL PRIVILEGES ON *.* TO \'root\'@\'%\' IDENTIFIED BY \'123456\' WITH GRANT OPTION;\r\n\r\nFLUSH PRIVILEGES;\r\nok了。\r\n\r\n–完–', 0);
INSERT INTO `document` VALUES (6, 'Linux安装ftp', 'Sean', '原创', '2018-09-26 15:38:45', 'Sean', 12, '## Linux安装ftp\r\n\r\nLinux最常用的是vsftp服务，下面我们来搭建一下。\r\n\r\n### 一、安装\r\n\r\n通过yarm源进行安装安装vsftpd服务\r\n\r\n```\r\nyum install -y vsftpd\r\n```\r\n\r\n### 二、配置\r\n\r\n#### 2.1 进入vsftpd的根目录\r\n\r\n```\r\ncd /etc/vsftpd/\r\n```\r\n\r\n**配置文件说明**\r\n\r\n* /etc/vsftpd/vsftpd.conf:vsftpd 的核心配置文件\r\n\r\n* /etc/vsftpd/ftpusers:用于指定哪些用户不能访问FTP 服务器  黑名单\r\n\r\n* /etc/vsftpd/user_list:指定允许使用vsftpd 的用户列表文件  白名单\r\n\r\n* /etc/vsftpd/chroot_list：指定允许使用vsftpd的用户列表文件。控制名单下的目录能不能离开ftp根目录\r\n\r\n\r\n添加ftp用户组\r\n\r\n```\r\ngroupadd ftpusers\r\n```\r\n\r\n添加ftp用户\r\n\r\n```\r\nuseradd -g ftpusers -s /sbin/nologin ftp_sean\r\npasswd ftp_sean\r\n```\r\n\r\n授权ftp_sean目录给ftp_sean\r\n\r\n```\r\nchown -R ftp_sean /home/ftp_sean\r\n```\r\n\r\n新建**chroot_list**文件\r\n\r\n```\r\nftp_sean\r\n```\r\n\r\n修改配置文件\r\n\r\n```\r\nanonymous_enable=NO\r\nlocal_enable=YES\r\nwrite_enable=YES\r\nlocal_umask=022\r\ndirmessage_enable=YES\r\nxferlog_enable=YES\r\nconnect_from_port_20=YES\r\nxferlog_std_format=YES\r\nchroot_local_user=NO\r\nallow_writeable_chroot=YES\r\nchroot_list_enable=YES\r\nchroot_list_file=/etc/vsftpd/chroot_list\r\nlisten=NO\r\nlisten_ipv6=YES\r\npam_service_name=vsftpd\r\nuserlist_enable=YES\r\ntcp_wrappers=YES\r\n```\r\n\r\n授权\r\n\r\n```\r\nchmod -R 777 /home/ftp_sean/\r\n```\r\n\r\n\r\n启动服务\r\n\r\n```\r\nservice vsftpd start\r\n```\r\n\r\n然后就可以连接啦!\r\n\r\n---\r\n\r\n--完--\r\n', '<article class=\"markdown-body\"><h2 id=\"linuxftp\">Linux安装ftp<a class=\"headerlink\" href=\"#linuxftp\" title=\"Permanent link\"></a></h2>\r\n<p>Linux最常用的是vsftp服务，下面我们来搭建一下。</p>\r\n<h3 id=\"_1\">一、安装<a class=\"headerlink\" href=\"#_1\" title=\"Permanent link\"></a></h3>\r\n<p>通过yarm源进行安装安装vsftpd服务</p>\r\n<div class=\"codehilite\"><pre>yum install -y vsftpd\r\n</pre></div>\r\n\r\n<h3 id=\"_2\">二、配置<a class=\"headerlink\" href=\"#_2\" title=\"Permanent link\"></a></h3>\r\n<h4 id=\"21-vsftpd\">2.1 进入vsftpd的根目录<a class=\"headerlink\" href=\"#21-vsftpd\" title=\"Permanent link\"></a></h4>\r\n<div class=\"codehilite\"><pre>cd /etc/vsftpd/\r\n</pre></div>\r\n\r\n<p><strong>配置文件说明</strong></p>\r\n<ul>\r\n<li>\r\n<p>/etc/vsftpd/vsftpd.conf:vsftpd 的核心配置文件</p>\r\n</li>\r\n<li>\r\n<p>/etc/vsftpd/ftpusers:用于指定哪些用户不能访问FTP 服务器  黑名单</p>\r\n</li>\r\n<li>\r\n<p>/etc/vsftpd/user_list:指定允许使用vsftpd 的用户列表文件  白名单</p>\r\n</li>\r\n<li>\r\n<p>/etc/vsftpd/chroot_list：指定允许使用vsftpd的用户列表文件。控制名单下的目录能不能离开ftp根目录</p>\r\n</li>\r\n</ul>\r\n<p>添加ftp用户组</p>\r\n<div class=\"codehilite\"><pre>groupadd ftpusers\r\n</pre></div>\r\n\r\n<p>添加ftp用户</p>\r\n<div class=\"codehilite\"><pre>useradd -g ftpusers -s /sbin/nologin ftp_sean\r\npasswd ftp_sean\r\n</pre></div>\r\n\r\n<p>授权ftp_sean目录给ftp_sean</p>\r\n<div class=\"codehilite\"><pre>chown -R ftp_sean /home/ftp_sean\r\n</pre></div>\r\n\r\n<p>新建<strong>chroot_list</strong>文件</p>\r\n<div class=\"codehilite\"><pre>ftp_sean\r\n</pre></div>\r\n\r\n<p>修改配置文件</p>\r\n<div class=\"codehilite\"><pre>anonymous_enable=NO\r\nlocal_enable=YES\r\nwrite_enable=YES\r\nlocal_umask=022\r\ndirmessage_enable=YES\r\nxferlog_enable=YES\r\nconnect_from_port_20=YES\r\nxferlog_std_format=YES\r\nchroot_local_user=NO\r\nallow_writeable_chroot=YES\r\nchroot_list_enable=YES\r\nchroot_list_file=/etc/vsftpd/chroot_list\r\nlisten=NO\r\nlisten_ipv6=YES\r\npam_service_name=vsftpd\r\nuserlist_enable=YES\r\ntcp_wrappers=YES\r\n</pre></div>\r\n\r\n<p>授权</p>\r\n<div class=\"codehilite\"><pre>chmod -R 777 /home/ftp_sean/\r\n</pre></div>\r\n\r\n<p>启动服务</p>\r\n<div class=\"codehilite\"><pre>service vsftpd start\r\n</pre></div>\r\n\r\n<p>然后就可以连接啦!</p>\r\n<hr />\r\n<p>&ndash;完&ndash;</p></article>', 'Linux安装ftp\r\nLinux最常用的是vsftp服务，下面我们来搭建一下。\r\n\r\n一、安装\r\n通过yarm源进行安装安装vsftpd服务\r\n\r\nyum install -y vsftpd\r\n二、配置\r\n2.1 进入vsftpd的根目录\r\ncd /etc/vsftpd/\r\n配置文件说明\r\n\r\n/etc/vsftpd/vsftpd.conf:vsftpd 的核心配置文件\r\n\r\n/etc/vsftpd/ftpusers:用于指定哪些用户不能访问FTP 服务器 黑名单\r\n\r\n/etc/vsftpd/user_list:指定允许使用vsftpd 的用户列表文件 白名单\r\n\r\n/etc/vsftpd/chroot_list：指定允许使用vsftpd的用户列表文件。控制名单下的目录能不能离开ftp根目录\r\n\r\n添加ftp用户组\r\n\r\ngroupadd ftpusers\r\n添加ftp用户\r\n\r\nuseradd -g ftpusers -s /sbin/nologin ftp_sean\r\npasswd ftp_sean\r\n授权ftp_sean目录给ftp_sean\r\n\r\nchown -R ftp_sean /home/ftp_sean\r\n新建chroot_list文件\r\n\r\nftp_sean\r\n修改配置文件\r\n\r\nanonymous_enable=NO\r\nlocal_enable=YES\r\nwrite_enable=YES\r\nlocal_umask=022\r\ndirmessage_enable=YES\r\nxferlog_enable=YES\r\nconnect_from_port_20=YES\r\nxferlog_std_format=YES\r\nchroot_local_user=NO\r\nallow_writeable_chroot=YES\r\nchroot_list_enable=YES\r\nchroot_list_file=/etc/vsftpd/chroot_list\r\nlisten=NO\r\nlisten_ipv6=YES\r\npam_service_name=vsftpd\r\nuserlist_enable=YES\r\ntcp_wrappers=YES\r\n授权\r\n\r\nchmod -R 777 /home/ftp_sean/\r\n启动服务\r\n\r\nservice vsftpd start\r\n然后就可以连接啦!\r\n\r\n–完–', 0);
INSERT INTO `document` VALUES (7, 'Linux安装git', 'Sean', '原创', '2018-09-26 15:40:19', 'Sean', 12, '## Linux安装git\r\n\r\n### 一、下载\r\n\r\n我们到[官网](https://mirrors.edge.kernel.org/pub/software/scm/git/)找到指定版本的源码，下载。\r\n\r\n```\r\nwget https://mirrors.edge.kernel.org/pub/software/scm/git/git-2.9.5.tar.gz\r\n```\r\n\r\n解压\r\n\r\n```\r\ntar -zxvf git-2.9.5.tar.gz\r\n```\r\n\r\n进入目录\r\n\r\n```\r\ncd git-2.9.5\r\n```\r\n\r\n### 二、编译安装\r\n\r\n#### 2.1 编译前\r\n\r\n安装依赖库\r\n\r\n```\r\nyum install curl-devel expat-devel gettext-devel openssl-devel zlib-devel gcc perl-ExtUtils-MakeMaker\r\n```\r\n\r\n#### 2.2 编译 \r\n\r\n```\r\n./configure prefix=/usr/local/git/\r\n\r\nmake && make install\r\n```\r\n\r\n\r\n#### 2.3 安装成功\r\n\r\n```\r\ngit --version\r\n```\r\n\r\n---\r\n\r\n--完--', '<article class=\"markdown-body\"><h2 id=\"linuxgit\">Linux安装git<a class=\"headerlink\" href=\"#linuxgit\" title=\"Permanent link\"></a></h2>\r\n<h3 id=\"_1\">一、下载<a class=\"headerlink\" href=\"#_1\" title=\"Permanent link\"></a></h3>\r\n<p>我们到<a href=\"https://mirrors.edge.kernel.org/pub/software/scm/git/\">官网</a>找到指定版本的源码，下载。</p>\r\n<div class=\"codehilite\"><pre>wget https://mirrors.edge.kernel.org/pub/software/scm/git/git-2.9.5.tar.gz\r\n</pre></div>\r\n\r\n<p>解压</p>\r\n<div class=\"codehilite\"><pre>tar -zxvf git-2.9.5.tar.gz\r\n</pre></div>\r\n\r\n<p>进入目录</p>\r\n<div class=\"codehilite\"><pre>cd git-2.9.5\r\n</pre></div>\r\n\r\n<h3 id=\"_2\">二、编译安装<a class=\"headerlink\" href=\"#_2\" title=\"Permanent link\"></a></h3>\r\n<h4 id=\"21\">2.1 编译前<a class=\"headerlink\" href=\"#21\" title=\"Permanent link\"></a></h4>\r\n<p>安装依赖库</p>\r\n<div class=\"codehilite\"><pre>yum install curl-devel expat-devel gettext-devel openssl-devel zlib-devel gcc perl-ExtUtils-MakeMaker\r\n</pre></div>\r\n\r\n<h4 id=\"22\">2.2 编译<a class=\"headerlink\" href=\"#22\" title=\"Permanent link\"></a></h4>\r\n<div class=\"codehilite\"><pre>./configure prefix=/usr/local/git/\r\n\r\nmake &amp;&amp; make install\r\n</pre></div>\r\n\r\n<h4 id=\"23\">2.3 安装成功<a class=\"headerlink\" href=\"#23\" title=\"Permanent link\"></a></h4>\r\n<div class=\"codehilite\"><pre>git --version\r\n</pre></div>\r\n\r\n<hr />\r\n<p>&ndash;完&ndash;</p></article>', 'Linux安装git\r\n一、下载\r\n我们到官网找到指定版本的源码，下载。\r\n\r\nwget https://mirrors.edge.kernel.org/pub/software/scm/git/git-2.9.5.tar.gz\r\n解压\r\n\r\ntar -zxvf git-2.9.5.tar.gz\r\n进入目录\r\n\r\ncd git-2.9.5\r\n二、编译安装\r\n2.1 编译前\r\n安装依赖库\r\n\r\nyum install curl-devel expat-devel gettext-devel openssl-devel zlib-devel gcc perl-ExtUtils-MakeMaker\r\n2.2 编译\r\n./configure prefix=/usr/local/git/\r\n\r\nmake && make install\r\n2.3 安装成功\r\ngit --version\r\n–完–', 0);
INSERT INTO `document` VALUES (8, 'Linux安装maven', 'Sean', '原创', '2018-09-26 15:41:42', 'Sean', 12, '## Linux安装maven\r\n\r\n### 一、下载\r\n\r\n我们到[官网](http://maven.apache.org/download.cgi#)找到指定的版本下载。\r\n\r\n运行下面命令下载\r\n\r\n```\r\nwget http://ftp.wayne.edu/apache/maven/maven-3/3.5.4/binaries/apache-maven-3.5.4-bin.tar.gz\r\n```\r\n\r\n解压\r\n\r\n```\r\ntar -zxvf apache-maven-3.5.4-bin.tar.gz\r\n```\r\n\r\n### 二、配置环境变量\r\n\r\n```\r\nvim /etc/profile\r\n```\r\n\r\n添加以下内容\r\n\r\n```\r\n#set maven environment\r\nexport M2_HOME=/usr/src/maven/apache-maven-3.5.4\r\nexport M2_HOME\r\nexport PATH=$PATH:$M2_HOME/bin\r\n```\r\n\r\n使配置文件生效\r\n\r\n```\r\nsource /etc/profile\r\n```\r\n\r\n### 三、安装成功\r\n\r\n```\r\nmvn -version\r\n```\r\n\r\n---\r\n\r\n--完--', '<article class=\"markdown-body\"><h2 id=\"linuxmaven\">Linux安装maven<a class=\"headerlink\" href=\"#linuxmaven\" title=\"Permanent link\"></a></h2>\r\n<h3 id=\"_1\">一、下载<a class=\"headerlink\" href=\"#_1\" title=\"Permanent link\"></a></h3>\r\n<p>我们到<a href=\"http://maven.apache.org/download.cgi#\">官网</a>找到指定的版本下载。</p>\r\n<p>运行下面命令下载</p>\r\n<div class=\"codehilite\"><pre>wget http://ftp.wayne.edu/apache/maven/maven-3/3.5.4/binaries/apache-maven-3.5.4-bin.tar.gz\r\n</pre></div>\r\n\r\n<p>解压</p>\r\n<div class=\"codehilite\"><pre>tar -zxvf apache-maven-3.5.4-bin.tar.gz\r\n</pre></div>\r\n\r\n<h3 id=\"_2\">二、配置环境变量<a class=\"headerlink\" href=\"#_2\" title=\"Permanent link\"></a></h3>\r\n<div class=\"codehilite\"><pre>vim /etc/profile\r\n</pre></div>\r\n\r\n<p>添加以下内容</p>\r\n<div class=\"codehilite\"><pre>#set maven environment\r\nexport M2_HOME=/usr/src/maven/apache-maven-3.5.4\r\nexport M2_HOME\r\nexport PATH=$PATH:$M2_HOME/bin\r\n</pre></div>\r\n\r\n<p>使配置文件生效</p>\r\n<div class=\"codehilite\"><pre>source /etc/profile\r\n</pre></div>\r\n\r\n<h3 id=\"_3\">三、安装成功<a class=\"headerlink\" href=\"#_3\" title=\"Permanent link\"></a></h3>\r\n<div class=\"codehilite\"><pre>mvn -version\r\n</pre></div>\r\n\r\n<hr />\r\n<p>&ndash;完&ndash;</p></article>', 'Linux安装maven\r\n一、下载\r\n我们到官网找到指定的版本下载。\r\n\r\n运行下面命令下载\r\n\r\nwget http://ftp.wayne.edu/apache/maven/maven-3/3.5.4/binaries/apache-maven-3.5.4-bin.tar.gz\r\n解压\r\n\r\ntar -zxvf apache-maven-3.5.4-bin.tar.gz\r\n二、配置环境变量\r\nvim /etc/profile\r\n添加以下内容\r\n\r\n#set maven environment\r\nexport M2_HOME=/usr/src/maven/apache-maven-3.5.4\r\nexport M2_HOME\r\nexport PATH=$PATH:$M2_HOME/bin\r\n使配置文件生效\r\n\r\nsource /etc/profile\r\n三、安装成功\r\nmvn -version\r\n–完–', 1);
INSERT INTO `document` VALUES (9, 'Linux安装redis', 'Sean', '原创', '2018-09-26 15:45:10', 'Sean', 12, '## Linux安装redis\r\n\r\n### 一、安装\r\n\r\n```\r\nyum install redis\r\n```\r\n\r\n\r\n### 二、配置\r\n\r\n```\r\nvim /etc/redis.conf\r\n```\r\n\r\n修改配置为后台启动\r\n\r\n```\r\ndaemonize yes\r\n```\r\n\r\n设置密码\r\n\r\n```\r\nrequirepass nihao456\r\n```\r\n\r\n允许远程连接\r\n\r\n```\r\n#bind 127.0.0.1\r\nprotected-mode no\r\n```\r\n\r\n### 三、启动服务\r\n\r\n```\r\ncd /usr/bin/\r\n\r\n./redis-server /etc/redis.conf\r\n```\r\n\r\n', '<article class=\"markdown-body\"><h2 id=\"linuxredis\">Linux安装redis<a class=\"headerlink\" href=\"#linuxredis\" title=\"Permanent link\"></a></h2>\r\n<h3 id=\"_1\">一、安装<a class=\"headerlink\" href=\"#_1\" title=\"Permanent link\"></a></h3>\r\n<div class=\"codehilite\"><pre>yum install redis\r\n</pre></div>\r\n\r\n<h3 id=\"_2\">二、配置<a class=\"headerlink\" href=\"#_2\" title=\"Permanent link\"></a></h3>\r\n<div class=\"codehilite\"><pre>vim /etc/redis.conf\r\n</pre></div>\r\n\r\n<p>修改配置为后台启动</p>\r\n<div class=\"codehilite\"><pre>daemonize yes\r\n</pre></div>\r\n\r\n<p>设置密码</p>\r\n<div class=\"codehilite\"><pre>requirepass nihao456\r\n</pre></div>\r\n\r\n<p>允许远程连接</p>\r\n<div class=\"codehilite\"><pre>#bind 127.0.0.1\r\nprotected-mode no\r\n</pre></div>\r\n\r\n<h3 id=\"_3\">三、启动服务<a class=\"headerlink\" href=\"#_3\" title=\"Permanent link\"></a></h3>\r\n<div class=\"codehilite\"><pre>cd /usr/bin/\r\n\r\n./redis-server /etc/redis.conf\r\n</pre></div></article>', 'Linux安装redis\r\n一、安装\r\nyum install redis\r\n二、配置\r\nvim /etc/redis.conf\r\n修改配置为后台启动\r\n\r\ndaemonize yes\r\n设置密码\r\n\r\nrequirepass nihao456\r\n允许远程连接\r\n\r\n#bind 127.0.0.1\r\nprotected-mode no\r\n三、启动服务\r\ncd /usr/bin/\r\n\r\n./redis-server /etc/redis.conf', 1);
INSERT INTO `document` VALUES (10, 'Linux安装RabbitMQ', 'Sean', '原创', '2018-09-26 15:46:57', 'Sean', 12, '## Linux安装RabbitMQ\r\n\r\nRabbitMQ是erlang语言开发的，所以我们先安装erlang语言，再安装RabbitMQ。\r\n\r\n### 一、安装erlang\r\n\r\n到此[网站](https://bintray.com/rabbitmq/rpm/erlang)下载RabbitMQ的erlang\r\n\r\n```\r\nwget https://bintray.com/rabbitmq/rpm/download_file?file_path=erlang%2F20%2Fel%2F7%2Fx86_64%2Ferlang-20.3.8.7-1.el7.centos.x86_64.rpm\r\n```\r\n\r\n安装\r\n\r\n```\r\nyum install download_file\\?file_path\\=erlang%2F20%2Fel%2F7%2Fx86_64%2Ferlang-20.3.8.7-1.el7.centos.x86_64.rpm \r\n```\r\n\r\n\r\n### 二、安装RabbitMQ\r\n\r\n#### 2.1 下载安装\r\n\r\n到[官网](http://www.rabbitmq.com/install-rpm.html#downloads)下载合适版本rpm包。\r\n\r\n```\r\nwget https://dl.bintray.com/rabbitmq/all/rabbitmq-server/3.7.7/rabbitmq-server-3.7.7-1.el7.noarch.rpm\r\n```\r\n\r\n安装\r\n```\r\nyum install rabbitmq-server-3.7.7-1.el7.noarch.rpm \r\n```\r\n\r\n启动服务\r\n\r\n```\r\nservice rabbitmq-server start\r\n```\r\n\r\n查看服务状态\r\n\r\n```\r\nservice rabbitmq-server status\r\n```\r\n\r\n#### 2.2 配置\r\n\r\n增加用户,并授权\r\n\r\n```\r\nrabbitmqctl add_user admin password\r\nrabbitmqctl set_user_tags admin administrator\r\n```\r\n\r\n重启\r\n\r\n```\r\nservice rabbitmq-server stop\r\nservice rabbitmq-server start\r\n```\r\n\r\n#### 2.3 安装插件\r\n\r\n```\r\ncd /usr/sbin\r\n./rabbitmq-plugins enable rabbitmq_management\r\n```\r\n\r\n这时我们访问服务器15672端口，使用上面配置的用户和密码就可以登陆控制台了。\r\n\r\n---\r\n\r\n--完--', '<article class=\"markdown-body\"><h2 id=\"linuxrabbitmq\">Linux安装RabbitMQ<a class=\"headerlink\" href=\"#linuxrabbitmq\" title=\"Permanent link\"></a></h2>\r\n<p>RabbitMQ是erlang语言开发的，所以我们先安装erlang语言，再安装RabbitMQ。</p>\r\n<h3 id=\"erlang\">一、安装erlang<a class=\"headerlink\" href=\"#erlang\" title=\"Permanent link\"></a></h3>\r\n<p>到此<a href=\"https://bintray.com/rabbitmq/rpm/erlang\">网站</a>下载RabbitMQ的erlang</p>\r\n<div class=\"codehilite\"><pre>wget https://bintray.com/rabbitmq/rpm/download_file?file_path=erlang%2F20%2Fel%2F7%2Fx86_64%2Ferlang-20.3.8.7-1.el7.centos.x86_64.rpm\r\n</pre></div>\r\n\r\n<p>安装</p>\r\n<div class=\"codehilite\"><pre>yum install download_file\\?file_path\\=erlang%2F20%2Fel%2F7%2Fx86_64%2Ferlang-20.3.8.7-1.el7.centos.x86_64.rpm \r\n</pre></div>\r\n\r\n<h3 id=\"rabbitmq\">二、安装RabbitMQ<a class=\"headerlink\" href=\"#rabbitmq\" title=\"Permanent link\"></a></h3>\r\n<h4 id=\"21\">2.1 下载安装<a class=\"headerlink\" href=\"#21\" title=\"Permanent link\"></a></h4>\r\n<p>到<a href=\"http://www.rabbitmq.com/install-rpm.html#downloads\">官网</a>下载合适版本rpm包。</p>\r\n<div class=\"codehilite\"><pre>wget https://dl.bintray.com/rabbitmq/all/rabbitmq-server/3.7.7/rabbitmq-server-3.7.7-1.el7.noarch.rpm\r\n</pre></div>\r\n\r\n<p>安装\r\n<div class=\"codehilite\"><pre>yum install rabbitmq-server-3.7.7-1.el7.noarch.rpm \r\n</pre></div></p>\r\n<p>启动服务</p>\r\n<div class=\"codehilite\"><pre>service rabbitmq-server start\r\n</pre></div>\r\n\r\n<p>查看服务状态</p>\r\n<div class=\"codehilite\"><pre>service rabbitmq-server status\r\n</pre></div>\r\n\r\n<h4 id=\"22\">2.2 配置<a class=\"headerlink\" href=\"#22\" title=\"Permanent link\"></a></h4>\r\n<p>增加用户,并授权</p>\r\n<div class=\"codehilite\"><pre>rabbitmqctl add_user admin password\r\nrabbitmqctl set_user_tags admin administrator\r\n</pre></div>\r\n\r\n<p>重启</p>\r\n<div class=\"codehilite\"><pre>service rabbitmq-server stop\r\nservice rabbitmq-server start\r\n</pre></div>\r\n\r\n<h4 id=\"23\">2.3 安装插件<a class=\"headerlink\" href=\"#23\" title=\"Permanent link\"></a></h4>\r\n<div class=\"codehilite\"><pre>cd /usr/sbin\r\n./rabbitmq-plugins enable rabbitmq_management\r\n</pre></div>\r\n\r\n<p>这时我们访问服务器15672端口，使用上面配置的用户和密码就可以登陆控制台了。</p>\r\n<hr />\r\n<p>&ndash;完&ndash;</p></article>', 'Linux安装RabbitMQ\r\nRabbitMQ是erlang语言开发的，所以我们先安装erlang语言，再安装RabbitMQ。\r\n\r\n一、安装erlang\r\n到此网站下载RabbitMQ的erlang\r\n\r\nwget https://bintray.com/rabbitmq/rpm/download_file?file_path=erlang%2F20%2Fel%2F7%2Fx86_64%2Ferlang-20.3.8.7-1.el7.centos.x86_64.rpm\r\n安装\r\n\r\nyum install download_file\\?file_path\\=erlang%2F20%2Fel%2F7%2Fx86_64%2Ferlang-20.3.8.7-1.el7.centos.x86_64.rpm \r\n二、安装RabbitMQ\r\n2.1 下载安装\r\n到官网下载合适版本rpm包。\r\n\r\nwget https://dl.bintray.com/rabbitmq/all/rabbitmq-server/3.7.7/rabbitmq-server-3.7.7-1.el7.noarch.rpm\r\n安装\r\n\r\nyum install rabbitmq-server-3.7.7-1.el7.noarch.rpm \r\n启动服务\r\n\r\nservice rabbitmq-server start\r\n查看服务状态\r\n\r\nservice rabbitmq-server status\r\n2.2 配置\r\n增加用户,并授权\r\n\r\nrabbitmqctl add_user admin password\r\nrabbitmqctl set_user_tags admin administrator\r\n重启\r\n\r\nservice rabbitmq-server stop\r\nservice rabbitmq-server start\r\n2.3 安装插件\r\ncd /usr/sbin\r\n./rabbitmq-plugins enable rabbitmq_management\r\n这时我们访问服务器15672端口，使用上面配置的用户和密码就可以登陆控制台了。\r\n\r\n–完–', 0);
INSERT INTO `document` VALUES (11, 'Linux安装erlang', 'Sean', '原创', '2018-09-26 15:48:43', 'Sean', 12, '## Linux安装erlang\r\n\r\n\r\n#### 1.1 下载解压\r\n到 **[官网](http://erlang.org/download/)** 去找到合适的版本来下载。\r\n\r\n```\r\nwget http://erlang.org/download/otp_src_21.0.tar.gz\r\n\r\ntar -zxvf otp_src_21.0.tar.gz\r\n```\r\n\r\n#### 1.2 安装依赖库\r\n\r\n```\r\nyum install gcc glibc-devel make ncurses-devel openssl-devel autoconf\r\nyum install unixODBC unixODBC-devel\r\n```\r\n\r\n#### 1.3 编译安装\r\n\r\n```\r\n./configure --prefix=/usr/local/erlang --enable-hipe --enable-threads --enable-smp-support --enable-kernel-poll --without-javac\r\n\r\nmake && make install\r\n```\r\n\r\n#### 1.4 配置环境变量\r\n\r\n```\r\nvim /etc/profile\r\n\r\nexport PATH=$PATH:/usr/local/erlang/bin/ \r\n```\r\n\r\n#### 1.5 安装成功\r\n\r\n```\r\nerl \r\n```\r\n如果出现版本号就说明安装成功了。\r\n\r\n(ctrl + G 再按 a 退出)\r\n', '<article class=\"markdown-body\"><h2 id=\"linuxerlang\">Linux安装erlang<a class=\"headerlink\" href=\"#linuxerlang\" title=\"Permanent link\"></a></h2>\r\n<h4 id=\"11\">1.1 下载解压<a class=\"headerlink\" href=\"#11\" title=\"Permanent link\"></a></h4>\r\n<p>到 <strong><a href=\"http://erlang.org/download/\">官网</a></strong> 去找到合适的版本来下载。</p>\r\n<div class=\"codehilite\"><pre>wget http://erlang.org/download/otp_src_21.0.tar.gz\r\n\r\ntar -zxvf otp_src_21.0.tar.gz\r\n</pre></div>\r\n\r\n<h4 id=\"12\">1.2 安装依赖库<a class=\"headerlink\" href=\"#12\" title=\"Permanent link\"></a></h4>\r\n<div class=\"codehilite\"><pre>yum install gcc glibc-devel make ncurses-devel openssl-devel autoconf\r\nyum install unixODBC unixODBC-devel\r\n</pre></div>\r\n\r\n<h4 id=\"13\">1.3 编译安装<a class=\"headerlink\" href=\"#13\" title=\"Permanent link\"></a></h4>\r\n<div class=\"codehilite\"><pre>./configure --prefix=/usr/local/erlang --enable-hipe --enable-threads --enable-smp-support --enable-kernel-poll --without-javac\r\n\r\nmake &amp;&amp; make install\r\n</pre></div>\r\n\r\n<h4 id=\"14\">1.4 配置环境变量<a class=\"headerlink\" href=\"#14\" title=\"Permanent link\"></a></h4>\r\n<div class=\"codehilite\"><pre>vim /etc/profile\r\n\r\nexport PATH=$PATH:/usr/local/erlang/bin/ \r\n</pre></div>\r\n\r\n<h4 id=\"15\">1.5 安装成功<a class=\"headerlink\" href=\"#15\" title=\"Permanent link\"></a></h4>\r\n<p><div class=\"codehilite\"><pre>erl \r\n</pre></div>\r\n如果出现版本号就说明安装成功了。</p>\r\n<p>(ctrl + G 再按 a 退出)</p></article>', 'Linux安装erlang\r\n1.1 下载解压\r\n到 官网 去找到合适的版本来下载。\r\n\r\nwget http://erlang.org/download/otp_src_21.0.tar.gz\r\n\r\ntar -zxvf otp_src_21.0.tar.gz\r\n1.2 安装依赖库\r\nyum install gcc glibc-devel make ncurses-devel openssl-devel autoconf\r\nyum install unixODBC unixODBC-devel\r\n1.3 编译安装\r\n./configure --prefix=/usr/local/erlang --enable-hipe --enable-threads --enable-smp-support --enable-kernel-poll --without-javac\r\n\r\nmake && make install\r\n1.4 配置环境变量\r\nvim /etc/profile\r\n\r\nexport PATH=$PATH:/usr/local/erlang/bin/ \r\n1.5 安装成功\r\nerl \r\n如果出现版本号就说明安装成功了。\r\n(ctrl + G 再按 a 退出)', 1);
INSERT INTO `document` VALUES (12, 'Linux安装zookeeper', 'Sean', '原创', '2018-09-26 15:50:40', 'Sean', 12, '### Linux安装zookeeper\r\n\r\n#### 一、下载\r\n\r\n```\r\nwget http://archive.apache.org/dist/zookeeper/zookeeper-3.4.9/zookeeper-3.4.9.tar.gz\r\n```\r\n\r\n#### 二、解压\r\n\r\n```\r\ntar zxvf zookeeper-3.4.9.tar.gz\r\n```\r\n\r\n#### 三、修改配置\r\n\r\n```\r\ncd zookeeper-3.4.9\r\ncp conf/zoo_sample.cfg conf/zoo.cfg\r\nvim conf/zoo.cfg\r\n```\r\n\r\n#### 四、启动\r\n\r\n```\r\ncd bin/\r\n./zkServer.sh start\r\n```\r\n', '<article class=\"markdown-body\"><h3 id=\"linuxzookeeper\">Linux安装zookeeper<a class=\"headerlink\" href=\"#linuxzookeeper\" title=\"Permanent link\"></a></h3>\r\n<h4 id=\"_1\">一、下载<a class=\"headerlink\" href=\"#_1\" title=\"Permanent link\"></a></h4>\r\n<div class=\"codehilite\"><pre>wget http://archive.apache.org/dist/zookeeper/zookeeper-3.4.9/zookeeper-3.4.9.tar.gz\r\n</pre></div>\r\n\r\n<h4 id=\"_2\">二、解压<a class=\"headerlink\" href=\"#_2\" title=\"Permanent link\"></a></h4>\r\n<div class=\"codehilite\"><pre>tar zxvf zookeeper-3.4.9.tar.gz\r\n</pre></div>\r\n\r\n<h4 id=\"_3\">三、修改配置<a class=\"headerlink\" href=\"#_3\" title=\"Permanent link\"></a></h4>\r\n<div class=\"codehilite\"><pre>cd zookeeper-3.4.9\r\ncp conf/zoo_sample.cfg conf/zoo.cfg\r\nvim conf/zoo.cfg\r\n</pre></div>\r\n\r\n<h4 id=\"_4\">四、启动<a class=\"headerlink\" href=\"#_4\" title=\"Permanent link\"></a></h4>\r\n<div class=\"codehilite\"><pre>cd bin/\r\n./zkServer.sh start\r\n</pre></div></article>', 'Linux安装zookeeper\r\n一、下载\r\nwget http://archive.apache.org/dist/zookeeper/zookeeper-3.4.9/zookeeper-3.4.9.tar.gz\r\n二、解压\r\ntar zxvf zookeeper-3.4.9.tar.gz\r\n三、修改配置\r\ncd zookeeper-3.4.9\r\ncp conf/zoo_sample.cfg conf/zoo.cfg\r\nvim conf/zoo.cfg\r\n四、启动\r\ncd bin/\r\n./zkServer.sh start', 2);
INSERT INTO `document` VALUES (13, 'Linux安装dubbo管理控制台', 'Sean', '原创', '2018-09-26 15:51:58', 'Sean', 12, '### Linux安装dubbo管理控制台\r\n\r\n#### 一、克隆代码\r\n\r\n```\r\ngit clone https://github.com/apache/incubator-dubbo-ops.git\r\n```\r\n\r\n#### 二、修改配置\r\n\r\n```\r\ncd incubator-dubbo-ops/dubbo-admin/src/main/resources\r\nvim application.properties\r\n```\r\n\r\n```\r\nserver.port=7001\r\nspring.velocity.cache=false\r\nspring.velocity.charset=UTF-8\r\nspring.velocity.layout-url=/templates/default.vm\r\nspring.messages.fallback-to-system-locale=false\r\nspring.messages.basename=i18n/message\r\nspring.root.password=root\r\nspring.guest.password=guest\r\n\r\ndubbo.registry.address=zookeeper://127.0.0.1:2181 #zookeeper地址\r\n```\r\n\r\n\r\n#### 三、打包\r\n\r\n```\r\ncd incubator-dubbo-ops/dubbo-admin\r\nmvn clean package -Dmaven.test.skip=true\r\n```\r\n\r\n#### 四、启动\r\n\r\n修改文件名\r\n```\r\nmv dubbo-admin-0.0.1-SNAPSHOT.jar dubbo-admin.jar\r\n```\r\n\r\n启动\r\n\r\n```\r\nnohup java -jar dubbo-admin.jar >>dubbo-admin.out 2>&1&\r\n```\r\n\r\n#### 五、访问\r\n\r\n通过ip:7001访问，root默认密码root,guest默认密码guest\r\n', '<article class=\"markdown-body\"><h3 id=\"linuxdubbo\">Linux安装dubbo管理控制台<a class=\"headerlink\" href=\"#linuxdubbo\" title=\"Permanent link\"></a></h3>\r\n<h4 id=\"_1\">一、克隆代码<a class=\"headerlink\" href=\"#_1\" title=\"Permanent link\"></a></h4>\r\n<div class=\"codehilite\"><pre>git clone https://github.com/apache/incubator-dubbo-ops.git\r\n</pre></div>\r\n\r\n<h4 id=\"_2\">二、修改配置<a class=\"headerlink\" href=\"#_2\" title=\"Permanent link\"></a></h4>\r\n<div class=\"codehilite\"><pre>cd incubator-dubbo-ops/dubbo-admin/src/main/resources\r\nvim application.properties\r\n</pre></div>\r\n\r\n<div class=\"codehilite\"><pre>server.port=7001\r\nspring.velocity.cache=false\r\nspring.velocity.charset=UTF-8\r\nspring.velocity.layout-url=/templates/default.vm\r\nspring.messages.fallback-to-system-locale=false\r\nspring.messages.basename=i18n/message\r\nspring.root.password=root\r\nspring.guest.password=guest\r\n\r\ndubbo.registry.address=zookeeper://127.0.0.1:2181 #zookeeper地址\r\n</pre></div>\r\n\r\n<h4 id=\"_3\">三、打包<a class=\"headerlink\" href=\"#_3\" title=\"Permanent link\"></a></h4>\r\n<div class=\"codehilite\"><pre>cd incubator-dubbo-ops/dubbo-admin\r\nmvn clean package -Dmaven.test.skip=true\r\n</pre></div>\r\n\r\n<h4 id=\"_4\">四、启动<a class=\"headerlink\" href=\"#_4\" title=\"Permanent link\"></a></h4>\r\n<p>修改文件名\r\n<div class=\"codehilite\"><pre>mv dubbo-admin-0.0.1-SNAPSHOT.jar dubbo-admin.jar\r\n</pre></div></p>\r\n<p>启动</p>\r\n<div class=\"codehilite\"><pre>nohup java -jar dubbo-admin.jar &gt;&gt;dubbo-admin.out 2&gt;&amp;1&amp;\r\n</pre></div>\r\n\r\n<h4 id=\"_5\">五、访问<a class=\"headerlink\" href=\"#_5\" title=\"Permanent link\"></a></h4>\r\n<p>通过ip:7001访问，root默认密码root,guest默认密码guest</p></article>', 'Linux安装dubbo管理控制台\r\n一、克隆代码\r\ngit clone https://github.com/apache/incubator-dubbo-ops.git\r\n二、修改配置\r\ncd incubator-dubbo-ops/dubbo-admin/src/main/resources\r\nvim application.properties\r\nserver.port=7001\r\nspring.velocity.cache=false\r\nspring.velocity.charset=UTF-8\r\nspring.velocity.layout-url=/templates/default.vm\r\nspring.messages.fallback-to-system-locale=false\r\nspring.messages.basename=i18n/message\r\nspring.root.password=root\r\nspring.guest.password=guest\r\n\r\ndubbo.registry.address=zookeeper://127.0.0.1:2181 #zookeeper地址\r\n三、打包\r\ncd incubator-dubbo-ops/dubbo-admin\r\nmvn clean package -Dmaven.test.skip=true\r\n四、启动\r\n修改文件名\r\n\r\nmv dubbo-admin-0.0.1-SNAPSHOT.jar dubbo-admin.jar\r\n启动\r\n\r\nnohup java -jar dubbo-admin.jar >>dubbo-admin.out 2>&1&\r\n五、访问\r\n通过ip:7001访问，root默认密码root,guest默认密码guest', 5);
